import React, { Component } from 'react'

export default class Words extends Component {
    constructor(props){
        super(props);

        const token = localStorage.getItem('token');
        var data = jwt.decode(token);

        this.state = {
            token,
            isAdmin: data.isAdmin
        }
    }

    render() {
        return (
            <div>
                Words
            </div>
        )
    }
}
